mapper.select:
select d.*,p.job_number,p.cert_id
from ehr_salary_change_data d left join ehr_person p on d.person_id=p.person_id
where p.company_id=#{companyId,jdbcType=BIGINT}

	and d.monthly=#{monthly,jdbcType=VARCHAR}

	and d.salary_change_def_id=#{salaryChangeDefId,jdbcType=BIGINT}
	${@com.jabava.utils.privilege.AuthorisedPersonUtil@getUserAuthorisedPersonList("d.person_id")}

select d.*,p.job_number,p.cert_id
from ehr_salary_change_data d left join ehr_person p on d.person_id=p.person_id
where d.salary_change_def_id=#{salaryChangeDefId,jdbcType=BIGINT}

	and d.monthly=#{monthly,jdbcType=VARCHAR}


	and p.company_id=#{companyId,jdbcType=BIGINT}


	and d.person_id=#{personId,jdbcType=BIGINT}

${@com.jabava.utils.privilege.AuthorisedPersonUtil@getUserAuthorisedPersonList("d.person_id")}

mapper.delete:
delete from ehr_salary_change_data 
where salary_change_def_id=#{salaryChangeDefId,jdbcType=BIGINT} 
	and monthly=#{monthly,jdbcType=VARCHAR}
	${@com.jabava.utils.privilege.AuthorisedPersonUtil@getUserAuthorisedPersonList("person_id")}

